const Expenses = (props) => {
  const [filteredYear, setFilteredYear] = useState('2020')
  const yearSelectHandler = (enteredYear) => {
    console.log(enteredYear);
  };

  return (
    <div>
      <Card className="expenses">
      <ExpenseFilter onChangeFilter = {yearSelectHandler}/>
      <ExpenseItem expense = {props.expenseItems[0]}> </ExpenseItem>
      <ExpenseItem expense = {props.expenseItems[1]}> </ExpenseItem>
      <ExpenseItem expense = {props.expenseItems[2]}> </ExpenseItem>
      <ExpenseItem expense = {props.expenseItems[3]}> </ExpenseItem>
      </Card>
    </div>
  );
}

